{/* Попап подтверждения удаления  */}
function PopupWithSubmit() {
    return (
        <div className="popup popup__with-submit">
            <div className="popup__container popup__container-min popup__container-with-submit">
                <form className="popup__form popup__form-min popup__form-with-submit">
                    <button className="popup__close popup__close-with-submit" type="button"></button>
                    <h2 className="popup__title popup__title-with-submit">Вы уверены?</h2>
                    <button className="popup__submit popup__submit-min popup__submit-with-submit" type="submit">Да
                    </button>
                </form>
            </div>
        </div>
        )
}
export default PopupWithSubmit;
